import * as React from "react";
import styled from "styled-components";
export const Nav = () => {
  return (
    <StyledWrapper>
      <div>
        <nav className="nav navbar-expand-lg">
          <a className="navbar-brand" href="#">
            getfitwithme
          </a>
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav mr-auto">
              <li className="nav-item active">
                <a className="nav-link">
                  Rules<span className="sr-only">(current)</span>
                </a>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    </StyledWrapper>
  );
};

//https://www.muscleandstrength.com/workouts/muscle-and-strength-womens-workout
//https://www.youtube.com/watch?v=dYjdzpZv5yc
//https://menubar.io/reactjs-tables

const StyledWrapper = styled.div`
  .nav {
    background-color: #e4f4fa;
    height: 40px;
  }
`;
